import React from "react";
import { Link } from "react-router-dom";
const LaunchPadItems = (props) => {
  return (
    <div class="card my-3 mb-0 text-start mb-0 bg-dark text-light">
      <img
        src={props.image}
        class="card-img-top img-thumbnail bg-dark"
        alt="..."
        style={{ width: "500px", height: "270px" }}
      />
      <div class="card-body">
        <h5 class="card-title">{props.name}</h5>
        <h6 class="card-title">{props.fullName.slice(0, 10)}...</h6>

        <p class="card-text">{props.description.slice(0, 50)}...</p>
        <div class="card-body mb-0">
          <Link key={props.id} to={props.id} class="btn btn-outline-light">
            Read More
          </Link>
        </div>
      </div>
    </div>
    // </div>
  );
};

export default LaunchPadItems;
